import React, { Component } from 'react'
import MainTitle from '../../container/MainTitle'
import Btn from '../../container/Btn';
import Box from './Box';

class LiveStream extends Component {
    constructor() {
        super();
        this.mainTitle = {
            first: "live stream",
            title: "how to start your"
        }
    }
    render() {
        return (
            <section className='live-stream'>
                <MainTitle first="live stream">how to start your</MainTitle>
                <div className="boxes">
                    <Box />
                </div>
                <Btn name="go to profile" link="../profile"/>
            </section>
        )
    }
}

export default LiveStream;
